import React from 'react'
import { useState, useEffect } from 'react';
import { GetTicketDetail } from './GetTicketDetails.js'
export const SearchTicketById = (props) => {
    const [ticketData, setTicketData] = useState(null);
    let ticketId = props.ticketId
    useEffect(() => {
        const requestOptions = {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify({ ticketId: ticketId}),
        };
        getData();

        // we will use async/await to fetch this data
        async function getData() {
            const response = await fetch("http://localhost:8000/searchTicketById", requestOptions);
            const apiResponseData = await response.json();
            setTicketData(apiResponseData);
        }
    }, [ticketId]);
    return (
        <>
        {console.log(ticketData)}
            {ticketData.length>0 && <div><GetTicketDetail TicketDetail={ticketData[0]} /></div>}
        </>
    )
}
